import { createTheme, ThemeProvider } from "@material-ui/core/styles";

import NavBar from "./components/NavBar";
import "./App.css";
import Grid from "./components/Grid";

const theme = createTheme({
  palette: {
    primary: {
      main: "#2e1667",
    },
    secondary: {
      main: "#c7d8ed",
    },
  },
  typography: {
    fontFamily: ["Roboto"],
    h4: {
      fontWeight: 600,
      fontSize: 28,
      lineHeight: "2rem",
    },
    h5: {
      fontWeight: 100,
      lineHeight: "2rem",
    },
  },
});
function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar />
        <Grid
          icon={
            <SecurityIcon
              style={{ fill: "#4360A6", height: "125", width: "125" }}
            />
          }
          title="Secure"
          btnTitle="Show me More"
        />
        <Grid
          icon={
            <EventNoteIcon
              style={{ fill: "#449A76", height: "125", width: "125" }}
            />
          }
          title="Reliable"
          btnTitle="Show me More"
        />
        <Grid
          icon={
            <TrendingUpIcon
              style={{ fill: "#D05B2D", height: "125", width: "125" }}
            />
          }
          title="Performant"
          btnTitle="Show me More"
        />
      </ThemeProvider>
    </div>
  );
}

export default App;
